import React, { useEffect, useState } from 'react';

function HeaderInfo() {
    const [currPosition, setCurrPosition] = useState({ lat: null, lng: null });

    navigator.geolocation.getCurrentPosition((position) => {
        setCurrPosition({ lat: position.coords.latitude, lng: position.coords.longitude });
    });

    return (
        <>
            <div>
                <h3>Geocacher</h3>
            </div>
            <div>
                <h2>Current Location</h2>
                <h2>Latitude: {currPosition.lat}</h2>
                <h2>Longitude: {currPosition.lng}</h2>
            </div>
        </>
    )

}

